import React from "react";
import {AppContext} from "../App";

export const MyPokemonList = () => {
    const {state,dispatch} = React.useContext(AppContext);
    console.log(state)
    return(
        <>
        <h1>MyPokemonList</h1>
        {state.session ? state.session.map((item,idx) => {
            return <p key={idx}>{item}</p>
        }) : null}

        </>
    )
}
